export default () => (
  <p>
    Alterra is a full-service Agency Construction Management firm which
    specializes in complex, multi-million-dollar residences that require
    meticulous attention to architectural detail and finishes. Jeff Smith, the
    founder and principal of Alterra, is a seasoned professional who has been
    actively involved in the construction industry in Central Virginia for over
    30 years.
  </p>
);
